import {Component} from 'react';
import { render } from 'react-dom';
import "./App.css";

const Item = (props) =>{
  return(
    <div className="item">

    </div>
  );
}

const Container = (props) =>{
  return(
    <div className="container">
      {props.children}
    </div>
  );
}

export default class App extends Component{
  render()
  { 
    return(
      <div className="page">
        <Container>
          Hello World
        </Container>
      </div>
    );

  }
};
